CREATE TABLE IF NOT EXISTS roles (
    id  SERIAL PRIMARY KEY,
    name VARCHAR(50) NOT NULL UNIQUE
);


CREATE TABLE IF NOT EXISTS users (
    id SERIAL PRIMARY KEY,
    username VARCHAR(50) NOT NULL UNIQUE,
    password_hash VARCHAR(255) NOT NULL,
    role_id SMALLINT DEFAULT 2 REFERENCES roles(id) ON DELETE CASCADE,
    disabled BOOLEAN DEFAULT FALSE
);

CREATE TABLE IF NOT EXISTS tokens (
    user_id  SERIAL,
    token VARCHAR(512) NOT NULL UNIQUE,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    expire_at TIMESTAMP NOT NULL
);

CREATE TABLE IF NOT EXISTS clients (
    id SERIAL PRIMARY KEY,
    name VARCHAR(50) NOT NULL,
    email VARCHAR(50) NOT NULL UNIQUE,
    cpf CHAR(11) NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS sections (
    id SERIAL PRIMARY KEY,
    name VARCHAR(50) NOT NULL UNIQUE
);

CREATE TABLE IF NOT EXISTS products (
    id SERIAL PRIMARY KEY,
    description VARCHAR(50) NOT NULL,
    sell_value DECIMAL(9,2) NOT NULL,
    barcode varchar(50) NOT NULL UNIQUE,
    section_id SMALLINT NOT NULL REFERENCES sections(id) ON DELETE CASCADE,
    stock INT NOT NULL,
    expiration_date DATE
);

CREATE TABLE IF NOT EXISTS images (
    id  SERIAL PRIMARY KEY,
    product_id SMALLINT NOT NULL REFERENCES products(id) ON DELETE CASCADE,
    image bytea NOT NULL
);

